import { geolocated } from 'react-geolocated';

const baseURL = 'https://api.nasa.gov/planetary/earth/imagery';
const key = 'sha384-EVSTQN3/azprG1Anm3QDgpJLIm9Nao0Yz1ztcQTwFspd3yD65VohhpuuCOmLASjC';


   const NASA = async () => { 
    const { latitude, longitude } = coords;
    const { data } = await getLocationByLatLng(latitude, longitude);
    const keyword = (
        data.results[0].address_components.find(c =>
            c.types.includes("locality")
            ) || {}
            ).long_name;
            localStorage.setItem("keyword", keyword);
            keywordStore.setKeyword(keyword);

            return (
                <div className="main">
                    <div className="mainDiv">
                        <Button type="button" onClick={NASA}></Button>
                    </div>
                </div>
            );
        };

export default geolocated({
    positionOptions: {
        enableHighAccuracy: false
    },
    userDecisionTimeout: 5000
}) (NASA);
